styles:
.ngb-dp-weekday, .ngb-dp-week-number {
  line-height: 2rem;
}
.ngb-dp-day, .ngb-dp-weekday, .ngb-dp-week-number {
  width: 2rem;
  height: 2rem;      
}
.ngb-dp-day {
  cursor: pointer;
}
.ngb-dp-day.disabled, .ngb-dp-day.hidden {
  cursor: default;
}

:host {
  text-align: center;
  width: 2rem;
  height: 2rem;
  line-height: 2rem;      
  border-radius: 0.25rem;
}
:host.outside {
  opacity: 0.5;
}

:host {
  height: 2rem;
  line-height: 1.85rem;
}
:host.collapsed {
  margin-bottom: -2rem;        
}
.ngb-dp-navigation-chevron::before {
  border-style: solid;
  border-width: 0.2em 0.2em 0 0;
  content: '';
  display: inline-block;
  height: 0.75em;
  transform: rotate(-135deg);
  -webkit-transform: rotate(-135deg);
  -ms-transform: rotate(-135deg);
  width: 0.75em;
  margin: 0 0 0 0.5rem;
}    
.ngb-dp-navigation-chevron.right:before {
  -webkit-transform: rotate(45deg);
  -ms-transform: rotate(45deg);
  transform: rotate(45deg);
  margin: 0 0.5rem 0 0;
}
.btn-link {
  cursor: pointer;
  outline: 0;
}
.btn-link[disabled] {
  cursor: not-allowed;
  opacity: .65;
}

select {
  /* to align with btn-sm */
  padding: 0.25rem 0.5rem;
  font-size: 0.875rem;      
  line-height: 1.25;
  /* to cancel the custom height set by custom-select */
  height: inherit;
  width: 50%;
}

:host {
  border: 1px solid rgba(0, 0, 0, 0.125);
}
.ngb-dp-header {
  border-bottom: 1px solid rgba(0, 0, 0, 0.125);
}
.ngb-dp-month {
  pointer-events: none;
}
ngb-datepicker-month-view {
  pointer-events: auto;
}
.ngb-dp-month:first-child {
  margin-left: 0 !important;
}    
.ngb-dp-month-name {
  font-size: larger;
  height: 2rem;
  line-height: 2rem;
}

.ngb-tp {
  display: flex;
  align-items: center;
}

.ngb-tp-hour, .ngb-tp-minute, .ngb-tp-second, .ngb-tp-meridian {
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: space-around;
}

.ngb-tp-spacer {
  width: 1em;
  text-align: center;
}

.chevron::before {
  border-style: solid;
  border-width: 0.29em 0.29em 0 0;
  content: '';
  display: inline-block;
  height: 0.69em;
  left: 0.05em;
  position: relative;
  top: 0.15em;
  transform: rotate(-45deg);
  -webkit-transform: rotate(-45deg);
  -ms-transform: rotate(-45deg);
  vertical-align: middle;
  width: 0.71em;
}

.chevron.bottom:before {
  top: -.3em;
  -webkit-transform: rotate(135deg);
  -ms-transform: rotate(135deg);
  transform: rotate(135deg);
}

.btn-link {
  outline: 0;
}

.btn-link.disabled {
  cursor: not-allowed;
  opacity: .65;
}

input {
  text-align: center;
  display: inline-block;
  width: auto;
}
